import "./ExpenseItem.css";

function ExpenseItem(){

    return <div>
         <div className="expense-item">12th march 2020</div>
         <div>
            <h1 className="expense-item__description">Car Insurance</h1>
            <div className="expense-item"></div>
            <h2>$200</h2>
         </div>
    </div>

}



export default ExpenseItem;
